      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 - - 13 + + col2 * + col1 + + 60 NOT BETWEEN ( + col2 ) AND col0 / col2 + col2;
  - name: tab0

outputs:
